import React from 'react';

class Note extends React.Component {
    render() {
        let { note } = this.props;
        return(
            <>

            <li class="my-3">
                <label style={{ color: "white" }}>
                    <span style={{ fontWeight: "bold" }}>{note.date} -</span> {note.noteTitle}
                </label>
            </li>

            <textarea
                className="textarea"
                value={note.noteDescription}
                style={{
                    backgroundColor: "#1a1c20",
                    borderColor: "grey"
                }}
                aria-label="note description"
                disabled
            />
            </>
  
        )
    }
}

export default Note;
